using System;using HECSFramework.Core;using Newtonsoft.Json;using HECSFramework.Serialize;using Components;using System.Collections.Generic;namespace HECSFramework.Serialize{	[JsonObject, Serializable]	public partial struct PlayerUpgradeComponentJSONResolver : IJSONResolver<PlayerUpgradeComponent,PlayerUpgradeComponentJSONResolver>	{		[JsonProperty("CountersUpgrades")]		public Dictionary<int, int> CountersUpgrades;		public PlayerUpgradeComponentJSONResolver In(ref PlayerUpgradeComponent playerupgradecomponent)		{			this.CountersUpgrades = playerupgradecomponent.CountersUpgrades;			return this;		}		public void Out(ref PlayerUpgradeComponent playerupgradecomponent)		{			playerupgradecomponent.CountersUpgrades = this.CountersUpgrades;		}	}}